// Resume.js
import React from 'react';

const Resume = () => {
  const containerStyles = {
    padding: '20px',
    fontFamily: 'Arial, sans-serif',
  };

  const headingStyles = {
    fontSize: '24px',
    color: 'beige',
    marginBottom: '10px',
  };

  const subheadingStyles = {
    fontSize: '18px',
    color: 'beige',
    marginBottom: '8px',
  };

  const linkStyles = {
    color: 'beige',
    textDecoration: 'none',
    marginRight: '10px',
  };

  const proficiencyStyles = {
    fontSize: '16px',
    color: 'beige',
  };

  return (
    <div style={containerStyles}>
      <h2 style={headingStyles}>Resume</h2>
      <p style={proficiencyStyles}>Download my resume:</p>
      <a href="url-to-your-resume.pdf" style={linkStyles} target="_blank" rel="noopener noreferrer">
        Download Resume
      </a>

      <h3 style={subheadingStyles}>Proficiencies</h3>
      <ul style={proficiencyStyles}>
        <li>React.js</li>
        <li>JavaScript</li>
        {/* Add more proficiencies as needed */}
      </ul>
    </div>
  );
};

export default Resume;
